                  <button>DIRECTOR</button>
                </Link>
                <Link
                  to={{
                    pathname: '/gif'
                  }}
                >
                  <button>GIf</button>
                </Link>
                <Link
                  to={{
                    pathname: '/motiondesign'
                  }}
                >
                  <button>MOTION DESIGN</button>
                </Link>
            </div>
        );
    }
}

export default Header
